/**
 * @param {number[]} nums
 * @return {number}
 */
var maximumTripletValue = function(nums) {
    let maxProduct = 0;
    let max = Array(2).fill(-Infinity), min = Array(2).fill(Infinity);

    for (const num of nums) {
        if (num > max[0]) {
            max[1] = max[0];
            max[0] = num;
        } else if (num > max[1]) {
            max[1] = num;
        }

        if (num < min[0]) {
            min[1] = min[0];
            min[0] = num;
        } else if (num < min[1]) {
            min[1] = num;
        }
    }

    for (const num of nums) {
        maxProduct = Math.max(maxProduct, (max[0] - min[0]) * num, (max[0] - min[1]) * num);
    }

    return maxProduct;
};
